// EventDetails.js
import React, { useEffect, useState } from 'react';
import { View, Text, Image, StyleSheet } from 'react-native';
import userApi from '../api/userApi';

const EventDetails = ({ route }) => {
  const { event } = route.params;
  const [hostData, setHostData] = useState(null)
    useEffect(() => {
        const getHostData = async () => {
            const host = await userApi.getUserInfo(event.host);
            console.log(host)
            setHostData(host)
        }
        getHostData();
    }, [])

  const formatDate = (dateString) => {
    // Implement your date formatting logic
    return new Date(dateString).toLocaleDateString();
  };

  const formatTime = (timeString) => {
    // Implement your time formatting logic
    return new Date(timeString).toLocaleTimeString('en-US', {
      hour: 'numeric',
      minute: 'numeric',
      hour12: true,
    });
  };

  return (
    <View style={styles.container}>
      <Text style={styles.headerText}>{event.eventName}</Text>

      <View style={styles.row}>
        <Text style={styles.label}>Date:</Text>
        <Text style={styles.value}>{formatDate(event.date)}</Text>
      </View>

      <View style={styles.row}>
        <Text style={styles.label}>Start Time:</Text>
        <Text style={styles.value}>{formatTime(event.startTime)}</Text>
      </View>

      <View style={styles.row}>
        <Text style={styles.label}>End Time:</Text>
        <Text style={styles.value}>{formatTime(event.endTime)}</Text>
      </View>

      <View style={styles.row}>
        <Text style={styles.label}>Address:</Text>
        <Text style={styles.value}>{event.address}</Text>
      </View>

      <View style={styles.row}>
        <Text style={styles.label}>Capacity:</Text>
        <Text style={styles.value}>{event.capacity} people</Text>
      </View>

      <View style={styles.row}>
        <Text style={styles.label}>Description:</Text>
        <Text style={styles.value}>{event.description}</Text>
      </View>

      <View style={styles.row}>
        <Text style={styles.label}>Host:</Text>
        <View style={styles.hostContainer}>
          <Text style={styles.username}>{hostData.username}</Text>
          <View style={styles.iconContainer}>
            <Image source={require('../assets/message.png')} style={styles.icon} />
            <Image source={require('../assets/blockUser.png')} style={styles.icon} />
            <Image source={require('../assets/addFriend.png')} style={styles.icon} />
          </View>
        </View>
      </View>

      <View style={styles.row}>
        <Text style={styles.label}>Recurring:</Text>
        <Text style={styles.value}>{event.recurring ? "Yes" : "No"}</Text>
      </View>

      <View style={styles.row}>
        <Text style={styles.label}>RSVPs:</Text>
        <Text style={styles.value}>{event.rsvps.length}</Text>
      </View>

      {/* Example: Display pictures if available */}
      {event.pictures && event.pictures.length > 0 && (
        <View>
          <Text style={styles.headerText}>Pictures:</Text>
          <View style={styles.imageContainer}>
            {event.pictures.map((picture, index) => (
              <Image key={index} source={{ uri: picture }} style={styles.image} />
            ))}
          </View>
        </View>
      )}

    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    padding: 20,
  },
  row: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    marginBottom: 10,
  },
  headerText: {
    fontSize: 18,
    fontWeight: 'bold',
    marginBottom: 10,
  },
  label: {
    fontWeight: 'bold',
    marginRight: 10,
  },
  value: {
    flex: 1,
  },
  imageContainer: {
    flexDirection: 'row',
    flexWrap: 'wrap',
    marginTop: 10,
  },
  image: {
    width: 100,
    height: 100,
    margin: 5,
  },
  hostContainer: {
    flexDirection: 'row',
    alignItems: 'center',
    justifyContent: 'space-between', // Align items to the start and end
    borderWidth: 1,
    borderRadius: 12,
    padding: 8,
    flex: 1, // Take up remaining width
  },
  username: {
    marginRight: 10,
  },
  iconContainer: {
    flexDirection: 'row',
    alignItems: 'flex-end', // Align to the bottom
    justifyContent: 'flex-end', // Align to the right
  },
  icon: {
    width: 20,
    height: 20,
    marginLeft: 5,
  },
});

export default EventDetails;
